import { Component } from '@angular/core';
import { Register } from '../../models/register.model';
import { attendee } from 'src/app/models/attendee.model';
import { PersonType } from 'src/app/models/person-type.model';

@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.less'],
})
export class RegistrationComponent {
  register: Register;
  title = false;

  ngOnInit() {
    this.register.attendee.personType = PersonType.getAllPersonTypes();
  }

  constructor() {
    this.register = new Register();
  }

  log() {
    console.log(this.register.attendee.personType);
  }

  validateId() {
    return this.register.attendee.personType.find((x) => x.isSelected === true);
  }
}
